;; **
;;; ## Distributions
;; **

;; @@
(defn plot-lt-dist [[id coll]]
(let [dat {:counts (map incntr/log (remove #{0} (lifetime id t0 tmax :distribution)))}]
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :counts]]
         [:geom_histogram [:aes {:y :..density.. }] {:binwidth 0.5 :colour "black" :fill "white"}]
         [:geom_density {:alpha 0.2 :fill "red"}]
         [:xlab "e^x hours"]
         [:ylab "Density"]
         [:theme_bw]
         [:ggtitle (str "Lifetime distribution of " (element-name coll))])]
      {:width 5 :height 5})))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;hollow-canyon/plot-lt-dist</span>","value":"#'hollow-canyon/plot-lt-dist"}
;; <=

;; @@
#_(for [b broadcasters]
  (plot-lt-dist b))
;; @@

;; **
;;; ## Evolution
;; **

;; @@
(let [curr (->>   broadcasters
                  (map (fn [[id author]] (map :mean (lifetime id t0 tmax :evolution))))
                  (apply map vector)
                  (map stats/mean)
                  )
       dat {:count curr
            :days (range (count curr))}]
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :days :count]]
         [:geom_line {:color "#222222"}]
         [:xlab "Day"]
         [:ylab "Lifetime in hours"]
         [:theme_bw]
         [:ggtitle "Average lifetime evolution"])]
      {:width 5 :height 5}))
